// UserProfile.js

import React from "react";
import { useLocation } from "react-router-dom";
const UserProfile = ({ studentName, otherDetails }) => {
  return (
    <div>
      <h2>User Profile</h2>
      <p>Student Name: {studentName}</p>
      <p>Other Details: {otherDetails}</p>
    </div>
  );
};

export default UserProfile;
